import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <Link to="/" className="navbar-link">Home</Link>
            <div className="navbar-item">
                <Link to="/services" className="navbar-link">Services</Link>
                <div className="dropdown-menu">
                    <Link to="/services/planning" className="dropdown-item">
                        Wedding Planning <i className="icon-arrow">⮞</i>
                    </Link>
                    <Link to="/services/vendor" className="dropdown-item">
                        Vendor Management <i className="icon-arrow">⮞</i>
                    </Link>
                    <Link to="/services/consultation" className="dropdown-item">
                        Consultation <i className="icon-arrow">⮞</i>
                    </Link>
                </div>
            </div>
            <Link to="/about" className="navbar-link">About Us</Link>
            <Link to="/contact" className="navbar-link">Contact</Link>
        </nav>
    );
};

export default Navbar;
